Rules.InvariantScript:
If(
    LV1Title <> ThisItem.Result,
    Set(
        LV1Title,
        ThisItem.Result
    ),
    Set(
        LV1Title,
        ""
    )
);

If(
    Gallery_GNBSub_GNB.Visible=true,
    CountRows(
        Filter(
            GNB_MENU, LV1=CheckedLV1,
            !IsEmpty(Users) Or
            !IsEmpty(Teams)
        )
    ) *64
)

ForAll(
    Distinct(
        Filter(
            SortByColumns(
                GNB_MENU,
                "LV1Order",
                SortOrder.Ascending
            ),
            !IsNumeric(LV1),
            !IsBlank(Users) || !IsBlank(Teams),
            Office365사용자.MyProfile().Mail in Users.Email || Office365사용자.MyProfile().Mail in Teams.Email
        ),
        LV1
    ),
    {Result: ThisRecord.Value}
)
